import React from 'react'
import Header from './Header'
import { useState, useEffect } from 'react'

function Users() {
    const [error, setError] = useState(null);
    const [isLoaded, setIsLoaded] = useState(false);
    const [items, setItems] = useState([]);



    useEffect(() => {
        fetch("http://localhost:3005/users")
            .then(res => res.json())
            .then(
                (result) => {
                    setIsLoaded(true);
                    setItems(result);
                },
                (error) => {
                    setIsLoaded(true);
                    setError(error);
                }
            )
    }, [])

    if (error) {
        return <div>Error: {error.message}</div>;
    } else if (!isLoaded) {
        return <div>Loading...</div>;
    } else {
        return (
            <>
                <Header />
                <div style={{textAlign:'center'}}>
                    <form >
                        <label for="Name">Enter Name:</label><br />
                        <input type="text" id="Name" name="Name"/><br />
                        <label for="Username">Enter Username:</label><br />
                        <input type="text"  id="Username" name="Username"/><br />
                        <label for="Email">Enter Email:</label><br />
                        <input type="text" id="title" name="title"/><br />
                        <label for="title">Enter Address:</label><br />
                        <input type="text" id="title" name="title"/><br />
                        <label for="title">Enter Phone:</label><br />
                        <input type="text" id="title" name="title"/><br />
                        <label for="title">Enter Website:</label><br />
                        <input type="text" id="title" name="title"/><br />
                        <label for="title">Enter Company:</label><br />
                        <input type="text" id="title" name="title"/><br />
                        <button type="submit">Submit</button>
                    </form>
                </div>
                <ul>
                    {items.map(item => (
                        <li key={item.id}>{item.id}
                            <ul>
                                <li>Name: {item.name}</li>
                                <li>Email: {item.email}</li>
                                <li>Username: {item.username}</li>
                                Address:
                                <ul>
                                    <li>street : {item.address.street}</li>
                                    <li>suite : {item.address.suite}</li>
                                    <li>city : {item.address.city}</li>
                                    <li>zipcode : {item.address.zipcode}</li>
                                    Geo:
                                    <ul>
                                        <li>lat : {item.address.geo.lat}</li>
                                        <li>lng : {item.address.geo.lng}</li>
                                    </ul>
                                </ul>
                                <li>phone: {item.phone}</li>
                                <li>website: {item.website}</li>
                                company:
                                <ul>
                                    <li>name : {item.company.name}</li>
                                    <li>catchPhrase : {item.company.catchPhrase}</li>
                                    <li>bs : {item.company.bs}</li>
                                </ul>
                            </ul>
                        </li>
                    ))}
                </ul>
            </>
        );
    }
}
export default Users
